define('text!views/import.html',[],function () { return '<section>\n\t<h2>Import</h2>\n\t<div class="panel">\n    <button class="btn btn-primary" type="button" data-bind="click: startImport">Import</button>\n    <button class="btn" type="button" data-bind="click: testDataSeb">CSV</button>\n    <button class="btn" type="button" data-bind="click: testDataRdf">RDF</button>\n    <button class="btn" type="button" data-bind="click: testDataRdfs">RDFS</button>\n    <br/>\n    <textarea id="textarea_import" class="col-lg-12 form-control" rows="3" data-bind="textInput: dataToImport"></textarea>\n\t</div>\n  <!-- ko if: detecting -->\n  <div class="alert alert-warning" role="alert">Trying to detect format...</div>\n  <!-- /ko -->\n  <!-- ko ifnot: detecting -->\n  <!-- ko ifnot: importable -->\n  <div class="alert alert-warning" role="alert">Format not recognized or empty</div>\n  <!-- /ko -->\n  <!-- ko if: importable -->\n  <div class="alert alert-success" role="alert" data-bind="text:mime"></div>\n  <!-- /ko -->\n  <!-- /ko -->\n</section>\n\n<p/>\n<footer>&copy; Erik Larsson 2014</footer>';});

define('text!views/list.html',[],function () { return '<section>\n\t<h2>List</h2>\n  <div class="table-responsive">\n\t\t<table class="table table-hover">\n\t\t\t<thead>\n\t\t\t\t<th>Date</th>\n\t\t\t\t<th>Description</th>\n\t\t\t\t<th>Amount</th>\n\t\t\t\t<th>Category</th>\n\t\t\t</thead>\n\t\t\t<tbody data-bind="foreach: verifications">\n\t\t\t\t<tr>\n\t\t\t\t\t<td data-bind="text: date.value"></td>\n\t\t\t\t\t<td data-bind="text: description.value"></td>\n\t\t\t\t\t<td data-bind="text: amount.value"></td>\n\t\t\t\t\t<td class="category"><input data-bind="value: category ? category.value : \'Uncategorized\'"/>\n\t\t\t\t\t\t<!--<input class="category" data-bind="text: category.value ? category.value : \'Uncategorized\', css: {uncategorized: !category.value, single: category.value && !patternId, pattern: category.value && patternId}"/>-->\n\t\t\t\t\t</td>\n\t\t\t\t</tr>\n\t\t\t</tbody>\n\t\t</table>\n\t</div>\n</section>\n\n<p/>\n<footer>&copy; Erik Larsson 2014</footer>';});

define('text!views/prefix.html',[],function () { return '<section>\n  <h2>Prefixes</h2>\n  <div class="table-responsive">\n    <table class="table table-hover">\n      <thead>\n        <tr data-bind="foreach: headers">\n          <th data-bind="text: title, click: $parent.sort"></th>\n        </tr>\n      </thead>\n      <tbody>\n        <tr class="info">\n          <td>Default</td>\n          <td data-bind="text:defaultPrefix"></td>\n        </tr>\n        <!-- ko foreach: prefixes -->\n        <tr>\n          <td data-bind="text: prefix"></td>\n          <td data-bind="text: namespace"></td>\n        </tr>\n        <!-- /ko -->\n        <tr>\n          <td><input class="form-control" data-bind="value: prefix, valueUpdate:\'afterkeydown\', event: {keypress: addPrefix}" /></td>\n          <td><input class="form-control" data-bind="value: namespace, valueUpdate:\'afterkeydown\', event: {keypress: addPrefix}" /></td>\n        </tr>\n      </tbody>\n    </table>\n  </div>\n</section>\n\n<p/>\n<footer>&copy; Erik Larsson 2014</footer>';});

define('text!views/shell.html',[],function () { return '<div>\n    <nav class="navbar navbar-inverse navbar-fixed-top" role="navigation">\n      <div class="container">\n        <!-- Brand and toggle get grouped for better mobile display -->\n        <div class="navbar-header">\n          <button type="button" class="navbar-toggle collapsed" data-toggle="collapse" data-target="#bs-example-navbar-collapse-1">\n            <span class="sr-only">Toggle navigation</span>\n            <span class="icon-bar"></span>\n            <span class="icon-bar"></span>\n            <span class="icon-bar"></span>\n          </button>\n          <a class="navbar-brand" data-bind="attr: { href: router.navigationModel()[0].hash }">Workbench</a>\n        </div>\n\n        <!-- Collect the nav links, forms, and other content for toggling -->\n        <div class="collapse navbar-collapse" id="bs-example-navbar-collapse-1">\n          <ul class="nav navbar-nav" data-bind="foreach: router.navigationModel">\n            <li data-bind="css: { active: isActive }">\n                <a data-bind="attr: { href: hash }, html: title"></a>\n            </li>\n          </ul>\n        </div><!-- /.navbar-collapse -->\n      </div><!-- /.container-fluid -->\n    </nav>\n    \n    <div class="container page-host" data-bind="router: { transition:\'entrance\', cacheViews:true }"></div>\n</div>\n';});

define('text!views/sparql.html',[],function () { return '<section>\n\t\t<h2>SPARQL</h2>\n\t\t<div class="panel">\n\t\t\t\t<button class="btn btn-primary" id="button_sparql" type="button">Execute</button>\n\t\t\t\t<button class="btn" id="button_select" type="button">Select</button>\n\t\t\t\t<button class="btn" id="button_construct" type="button">Construct</button>\n\t\t\t\t<button class="btn" id="button_insert" type="button">Insert</button><br/>\n\t\t\t\t<textarea id="textarea_sparql" class="col-lg-12 form-control" rows="3">select * where { { graph ?g {?s ?p ?o} } union  {?s ?p ?o} } limit 10</textarea><br/>\n\t\t\t\t<textarea id="textarea_result" class="col-lg-12 form-control" rows="10"></textarea><br/>\n\t\t</div>\n</section>\n\n<p/>\n<footer>&copy; Erik Larsson 2014</footer>';});

define('text!views/table.html',[],function () { return '<section>\n  <h2>Table</h2>\n  <div class="table-responsive">\n    <table class="table table-hover">\n      <thead>\n        <tr data-bind="foreach: headers">\n          <th data-bind="text: label"></th>\n        </tr>\n      </thead>\n      <tbody data-bind="foreach: rows">\n        <tr data-bind="foreach: columns">\n          <td data-bind="text: value"></td>\n        </tr>\n      </tbody>\n    </table>\n  </div>\n</section>\n\n<p/>\n<footer>&copy; Erik Larsson 2014</footer>';});

